(function () {
    "use strict";

    let marketoFormWrappers = document.querySelectorAll('.marketo-form-stub-wrapper');

    let init = function (marketoFormWrapper) {
        let formWrapper = marketoFormWrapper.querySelector('.marketo-form-stub-form-wrapper');
        let formEl = formWrapper.querySelector('.marketo-form-stub-form');
        let submitButtonWrapper = formEl.querySelector('.marketo-form-stub-submit-button-wrapper');
        let submitButton = submitButtonWrapper.querySelector(`button[type='button']`);
        let turnstileIdNode = formEl.querySelector(`.cf-turnstile`);

        if (formEl != null && formEl.nodeName === "FORM") {
            formEl.addEventListener('submit', (el) => {
                el.preventDefault();
            });
        }

        setTurnstileWatcher(turnstileIdNode);

        if (submitButton != null && submitButton.nodeName === "BUTTON") {
            submitButton.addEventListener("click", transmitFormData);
        }
    }

    let collectFormData = function (formEl) {
        const TURNSTILE_RESPONSE = `cf-turnstile-response`;
        let submitJson = {};
        let formElements = formEl.elements;

        submitJson.input = [];
        submitJson.input[0] = {};
        submitJson.input[0].leadFormFields = {};
        [...formElements].forEach((formElement) => {
            if (formElement.name === "formid" && formElement.nodeName !== "BUTTON") {
                submitJson.formId = formElement.value;
            } else if(formElement.name === TURNSTILE_RESPONSE) {
                submitJson[TURNSTILE_RESPONSE] = formElement.value;
            } else {
                if (formElement.nodeName !== "BUTTON") submitJson.input[0].leadFormFields[formElement.name] = formElement.value;
            }
        });

        return submitJson;
    }

    let constructPostFetchUrl = function () {
        let protocol = window.location.protocol;
        let host = window.location.host;

        let newURLString = protocol + host;
        let resourcePath = document.querySelector('.marketo-form-stub-wrapper').getAttribute("data-currentNode");
        if(resourcePath){
            let newURLPathString = resourcePath + ".postform.json";

            let newURL = new URL(newURLPathString, newURLString);

            return newURL.toString();
        }
        return null;
    }

    let transmitFormData = async function (event) {
        let eventTarget = event.target;
        let buttonFormEl = eventTarget.closest(`form.marketo-form-stub-form`);
        let formData = collectFormData(buttonFormEl);
        let formDataString = JSON.stringify(formData);
        let fetchUrl = constructPostFetchUrl();

        if(fetchUrl){
            try {
                const response = await fetch(fetchUrl, {
                    method: "POST",
                    body: formDataString
                });
                const responseJson = await response.json();
            } catch (e) {
            }
        }
    }

    let initTurnstile = function (turnstileRenderSelector) {
        let renderTarget = document.querySelector(`#${turnstileRenderSelector}`);
        let renderTargetSitekey = renderTarget?.dataset?.sitekey;
        if(renderTargetSitekey !== null) {
            turnstile.render(`#${turnstileRenderSelector}`, {
                sitekey: `${renderTargetSitekey}`
            });
        }
    }

    let setTurnstileWatcher = function(turnstileIdNode) {
        let turnstileNodeId = turnstileIdNode.id;

        if(window?.turnstile != null) {
            initTurnstile(turnstileNodeId);
        } else {
            setTimeout(setTurnstileWatcher, 3000, turnstileNodeId);
        }
    }

    if (marketoFormWrappers !== null) {
        marketoFormWrappers.forEach((marketoFormWrapper) => init(marketoFormWrapper));
    }
}());
